    <style>
        body {
            margin: 0;
            padding: 0;
        }

        #map {
            position: absolute;
            top: 0;
            bottom: 0;
            width: 100%;
        }

        .sidebar {
            position: absolute;
            top: 10px;
            right: 10px;
        }

        .mapboxgl-ctrl-top-right {
            top: 250px;
            /* Ajuste este valor conforme necessário */
        }
    </style>
</head>
